(1209, 182, 1, 'Terms of service', 'Terms of service', '<!-- Terms of service -->\n<div class=\"tof-wrapper\">\n    <div class=\"container\">\n        <div class=\"tof-header\">\n            <h3><strong>Terms of service</strong></h3>\n        </div>\n    </div>\n</div>\n\n<div class=\"container\">\n    <div class=\"raw\">\n        <div class=\"tof-links\">\n            <li><a href=\"\">Privacy Policy</a></li>\n            <li><a href=\"\">Acceptable Use</a></li>\n            <li><a href=\"\">Advertising Standards</a></li>\n            <li><a href=\"\">Responsible Desclosure</a></li>\n        </div>\n        <div class=\"col-md-7 tof-main\">\n            <h4 class=\"tof-bold\">Thank you for using UDora!</h4>\n            <p class=\"tof-text\">\n                Lorem ipsum dolor sit amet, consectetur adipisicing elit. Voluptatibus incidunt qui ab ea atque tempora ducimus assumenda dolor hic dolores repellat eligendi, doloribus cupiditate, labore enim itaque non voluptate eaque minus consequatur ratione magni. Libero autem velit quae officia. Deserunt minima quaerat non, fugiat ratione magni iste officiis? Sed harum sapiente aut. Quae debitis voluptatibus provident nemo facere dolorum rerum?\n            </p>\n            \n            <!-- 1.Using UDora -->\n            <h4 class=\"tof-bold\">1. Using UDora</h4>\n            <p class=\"tof-bold tof-text\">a. Who can use UDora</p>\n            <p class=\"tof-text\">You may use our Products only if you can form a binding contract with UDora, and only in compliance with these Terms and all applicable laws. When you create your UDora account, you must provide us with accurate and complete information. Any use or access by anyone under the age of 13 is prohibited. If you open an account on behalf of a company, organization, or other entity, then (a) \"you\" includes you and that entity, and (b) you represent and warrant that you are authorized to grant all permissions and licenses provided in these Terms and bind the entity to these Terms, and that you agree to these Terms on the entity\'s behalf. Some of our Products may be software that is downloaded to your computer, phone, tablet, or other device. You agree that we may automatically upgrade those Products, and these Terms will apply to such upgrades.</p>\n            <p class=\"tof-bold tof-text\">b. Our license to you</p>\n            <p class=\"tof-text\">Subject to these Terms and our policies (including our Acceptable Usage Policy), we grant you a limited, non-exclusive, non-transferable, and revocable license to use our Products.</p>\n            <p class=\"tof-bold tof-text\">c. Commercial use of UDora</p>\n            <p class=\"tof-text\">If you want to use our Products for commercial purposes you must create a business account and agree to our Business Terms of Service.</p>\n            \n            <!-- 2. Your Content -->       \n            <h4 class=\"tof-bold\">2. Your Content</h4>\n            <p class=\"tof-bold tof-text\">a. Posting content</p>\n            <p class=\"tof-text\">UDora allows you to post content, including photos, comments, links, and other materials. Anything that you post or otherwise make available on our Products is referred to as \"User Content.\" You retain all rights in, and are solely responsible for, the User Content you post to UDora.</p>\n            <p class=\"tof-bold tof-text\">b. How UDora and other users can use your content</p>\n            <p class=\"tof-text\">You grant UDora and its users a non-exclusive, royalty-free, transferable, sublicensable, worldwide license to use, store, display, reproduce, re-pin, modify, create derivative works, perform, and distribute your User Content on UDora solely for the purposes of operating, developing, providing, and using the UDora Products. Nothing in these Terms shall restrict other legal rights UDora may have to User Content, for example under other licenses. We reserve the right to remove or modify User Content for any reason, including User Content that we believe violates these Terms or our policies.</p>\n            <p class=\"tof-bold tof-text\">c. How long we keep your content</p>\n            <p class=\"tof-text\">Following termination or deactivation of your account, or if you remove any User Content from UDora, we may retain your User Content for a commercially reasonable period of time for backup, archival, or audit purposes. Furthermore, UDora and its users may retain and continue to use, store, display, reproduce, re-pin, modify, create derivative works, perform, and distribute any of your User Content that other users have stored or shared through UDora.</p>\n            <p class=\"tof-bold tof-text\">d. Feedback you provide</p>\n            <p class=\"tof-text\">We value hearing from our users, and are always interested in learning about ways we can make UDora more awesome. If you choose to submit comments, ideas or feedback, you agree that we are free to use them without any restriction or compensation to you. By accepting your submission, UDora does not waive any rights to use similar or related Feedback previously known to UDora, or developed by its employees, or obtained from sources other than you.</p>\n            \n            <!-- 3. Copyright Policy -->      \n            <h4 class=\"tof-bold\">3. Copyright Policy</h4>\n            <p class=\"tof-text\">UDora has adopted and implemented the UDora Copyright Policy in accordance with the Digital Millennium Copyright Act. For more information, please read our Copyright Policy.</p>\n            \n            <!-- 4. Security -->         \n            <h4 class=\"tof-bold\">4. Security</h4>\n            <p class=\"tof-text\">We care about the security of our users. While we work to protect the security of your content and account, UDora cannot guarantee that unauthorized third parties will not be able to defeat our security measures. Please notify us immediately of any compromise or unauthorized use of your account.</p>\n            \n            <!-- 5. Third-Party Links, Sites, and Services -->       \n            <h4 class=\"tof-bold\">5. Third-Party Links, Sites, and Services</h4>\n            <p class=\"tof-text\">Our Products may contain links to third-party websites, advertisers, services, special offers, or other events or activities that are not owned or controlled by UDora. We do not endorse or assume any responsibility for any such third-party sites, information, materials, products, or services. If you access any third party website, service, or content from UDora, you do so at your own risk and you agree that UDora will have no liability arising from your use of or access to any third-party website, service, or content.</p>\n            \n            <!-- 6. Termination -->        \n            <h4 class=\"tof-bold\">6. Termination</h4>\n            <p class=\"tof-text\">UDora may terminate or suspend this license at any time, with or without cause or notice to you. Upon termination, you continue to be bound by Sections 2 and 6-12 of these Terms.</p>\n            \n            <!-- 7. Indemnity -->\n            <h4 class=\"tof-bold\">7. Indemnity</h4>\n            <p class=\"tof-text\">If you use our Products for commercial purposes in violation of Section 1(c), as determined in our sole and absolute discretion, you agree to indemnify and hold harmless UDora and its officers, directors, employees and agents, from and against any claims, suits, proceedings, disputes, demands, liabilities, damages, losses, costs and expenses, including, without limitation, reasonable legal and accounting fees (including costs of defense of claims, suits or proceedings brought by third parties), in any way related to (a) your access to or use of our Products, (b) your User Content, or (c) your breach of any of these Terms.</p>\n            \n            <!-- 8. Disclaimers -->  \n            <h4 class=\"tof-bold\">8. Disclaimers</h4>\n            <p class=\"tof-text\">\n                The Products and all included content are provided on an \"as is\" basis without warranty of any kind, whether express or implied. \n                <br><br>\n                UDora SPECIFICALLY DISCLAIMS ANY AND ALL WARRANTIES AND CONDITIONS OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE, AND NON-INFRINGEMENT, AND ANY WARRANTIES ARISING OUT OF COURSE OF DEALING OR USAGE OF TRADE.\n                <br><br>\n                UDora takes no responsibility and assumes no liability for any User Content that you or any other user or third party posts or transmits using our Products. You understand and agree that you may be exposed to User Content that is inaccurate, objectionable, inappropriate for children, or otherwise unsuited to your purpose.\n            </p>\n            \n            <!-- 9. Limitation of Liability -->          \n            <h4 class=\"tof-bold\">9. Limitation of Liability</h4>\n            <p class=\"tof-text\">TO THE MAXIMUM EXTENT PERMITTED BY LAW, UDora SHALL NOT BE LIABLE FOR ANY INDIRECT, INCIDENTAL, SPECIAL, CONSEQUENTIAL OR PUNITIVE DAMAGES, OR ANY LOSS OF PROFITS OR REVENUES, WHETHER INCURRED DIRECTLY OR INDIRECTLY, OR ANY LOSS OF DATA, USE, GOOD-WILL, OR OTHER INTANGIBLE LOSSES, RESULTING FROM (A) YOUR ACCESS TO OR USE OF OR INABILITY TO ACCESS OR USE THE PRODUCTS; (B) ANY CONDUCT OR CONTENT OF ANY THIRD PARTY ON THE PRODUCTS, INCLUDING WITHOUT LIMITATION, ANY DEFAMATORY, OFFENSIVE OR ILLEGAL CONDUCT OF OTHER USERS OR THIRD PARTIES; OR (C) UNAUTHORIZED ACCESS, USE OR ALTERATION OF YOUR TRANSMISSIONS OR CONTENT. IN NO EVENT SHALL UDora\'S AGGREGATE LIABILITY FOR ALL CLAIMS RELATING TO THE PRODUCTS EXCEED ONE HUNDRED U.S. DOLLARS (U.S. $100.00).</p>\n            \n            <!-- 10. Arbitration -->      \n            <h4 class=\"tof-bold\">10. Arbitration</h4>\n            <p class=\"tof-text\">For any dispute you have with UDora, you agree to first contact us and attempt to resolve the dispute with us informally. If UDora has not been able to resolve the dispute with you informally, we each agree to resolve any claim, dispute, or controversy (excluding claims for injunctive or other equitable relief) arising out of or in connection with or relating to these Terms by binding arbitration by the American Arbitration Association (\"AAA\") under the Commercial Arbitration Rules and Supplementary Procedures for Consumer Related Disputes then in effect for the AAA, except as provided herein. Unless you and UDora agree otherwise, the arbitration will be conducted in the county where you reside. Each party will be responsible for paying any AAA filing, administrative and arbitrator fees in accordance with AAA rules, except that UDora will pay for your reasonable filing, administrative, and arbitrator fees if your claim for damages does not exceed $75,000 and is non-frivolous (as measured by the standards set forth in Federal Rule of Civil Procedure 11(b)). The award rendered by the arbitrator shall include costs of arbitration, reasonable attorneys\' fees and reasonable costs for expert and other witnesses, and any judgment on the award rendered by the arbitrator may be entered in any court of competent jurisdiction. Nothing in this Section shall prevent either party from seeking injunctive or other equitable relief from the courts for matters related to data security, intellectual property or unauthorized access to the Service. ALL CLAIMS MUST BE BROUGHT IN THE PARTIES\' INDIVIDUAL CAPACITY, AND NOT AS A PLAINTIFF OR CLASS MEMBER IN ANY PURPORTED CLASS OR REPRESENTATIVE PROCEEDING, AND, UNLESS WE AGREE OTHERWISE, THE ARBITRATOR MAY NOT CONSOLIDATE MORE THAN ONE PERSON\'S CLAIMS. YOU AGREE THAT, BY ENTERING INTO THESE TERMS, YOU AND UDora ARE EACH WAIVING THE RIGHT TO A TRIAL BY JURY OR TO PARTICIPATE IN A CLASS ACTION.</p>\n            \n            <!-- 11. Governing Law and Jurisdiction -->               \n            <h4 class=\"tof-bold\">11. Governing Law and Jurisdiction</h4>\n            <p class=\"tof-text\">These Terms shall be governed by the laws of the State of California, without respect to its conflict of laws principles. We each agree to submit to the personal jurisdiction of a state court located in San Francisco County, California or the United States District Court for the Northern District of California, for any actions not subject to Section 10 (Arbitration).\n            <br><br>\n            Our Products are controlled and operated from the United States, and we make no representations that they are appropriate or available for use in other locations.</p>\n            \n            <!-- 12. General Terms -->     \n            <h4 class=\"tof-bold\">12. General Terms</h4>\n            <p class=\"tof-text\"><span class=\"tof-bold\">Notification Procedures and changes to these Terms.</span> UDora reserves the right to determine the form and means of providing notifications to you, and you agree to receive legal notices electronically if we so choose. We may revise these Terms from time to time and the most current version will always be posted on our website. If a revision, in our sole discretion, is material we will notify you. By continuing to access or use the Products after revisions become effective, you agree to be bound by the revised Terms. If you do not agree to the new terms, please stop using the Products.\n            <br><br>\n            <span class=\"tof-bold\">Assignment.</span> These Terms, and any rights and licenses granted hereunder, may not be transferred or assigned by you, but may be assigned by UDora without restriction. Any attempted transfer or assignment in violation hereof shall be null and void.\n            <br><br>\n            <span class=\"tof-bold\">Entire Agreement/Severability.</span> These Terms, together with the Privacy Policy and any amendments and any additional agreements you may enter into with UDora in connection with the Products, shall constitute the entire agreement between you and UDora concerning the Products. If any provision of these Terms is deemed invalid, then that provision will be limited or eliminated to the minimum extent necessary, and the remaining provisions of these Terms will remain in full force and effect.</p>\n        </div>\n        <div class=\"col-md-5 tof-second\">\n            <h4 class=\"tof-bold\">More simply put:</h4>\n            <p>1. Every company has its terms. These are ours.</p>\n            <br>\n            <p>2. You can use UDora unless you\'re under 13. Also, if your boss is making you use Pinterest, you need to set up a business account.</p>\n            <br>\n            <p>3. If you post your content on UDora, it still belongs to you but we can show it to people and others can re-pin it.</p>\n            <br>\n            <p>4. Copies of content shared with others may remain even after you delete the content from your account.</p>\n            <br>\n            <p>5. Also, don\'t post porn or spam or be a jerk to other Pinners. Oh, and we can actually use your suggestions to make Pinterest better.</p>\n            <br>\n            <p>6. We respect copyrights. You should, too.</p>\n            <br>\n            <p>7. You can help us fight spammers by keeping these security tips in mind.</p>\n            <br>\n            <p>8. Events link to content off of UDora. Most of that stuff is awesome but we\'re not responsible when it\'s not.</p>\n            <br>\n            <p>9. We reserve the right to refuse service to anyone.</p>\n            <br>\n            <p>10. If we are sued because of something your business does on UDora, you have to pay our costs. Also, you should have created a business account and agreed to our commercial terms in the first place.</p>\n            <br>\n            <p>11. Unfortunately, people post bad stuff on user-generated content sites like UDora. We take that kind of thing seriously but you still might run into it before we have a chance to take it down. If you see bad stuff, please report it to us.</p>\n            <br>\n            <p>12. We are building the best service we can for you but we can\'t promise it will be perfect. We\'re not liable for various things. If you think we are, let\'s try to work it out like adults.</p>\n            <br>\n            <br>\n        </div>\n    </div>\n</div>', '', 'Terms of service', NULL),
