(1649, 175, 1, 'Help', 'Help', '<div class=\"container help-n-support text-center pt-6 pb-6\">\n  <h3>Help and support</h3>\n  <div class=\"row d-flex flex-wrap\">\n\n      <div class=\"item\">\n        <div class=\"hi-icon ion-ios-help-outline\">&nbsp;</div>\n\n        <h4>\n          <a href=\"https://udora.io/production/index.php/en/161/faq\">Frequently Asked Questions</a>\n        </h4>\n\n        <p>See answers to your frequently asked questions all in one easy place. More questions and answers will be added as\n          we grow.</p>\n      </div>\n\n      <div class=\"item\">\n        <div class=\"hi-icon ion-ios-book-outline\">&nbsp;</div>\n\n        <h4>\n          <a href=\"https://udora.io/support/client/knowledge\">Knowledge Base</a>\n        </h4>\n\n        <p>Looking for answers? you are in the right place. Find the answer to any question, from the basics all the way to\n          advanced tips and tricks!</p>\n      </div>\n\n      <div class=\"item\">\n        <div class=\"hi-icon ion-ios-people-outline\">&nbsp;</div>\n\n        <h4>\n          <a href=\"https://udora.io/support/\">New Support Ticket</a>\n        </h4>\n\n        <p>Do you have a question or problem? The support ticket system allows us to respond to your inquiries. Submit a ticket\n          and we will get back to you.</p>\n      </div>\n\n      <div class=\"item\">\n        <div class=\"hi-icon ion-ios-eye-outline\">&nbsp;</div>\n\n        <h4>\n          <a href=\"https://udora.io/support/client/tickets\">View Support Tickets</a>\n        </h4>\n\n        <p>If you have created a ticket without a user account, you can view the ticket by entering the email address you used\n          and the ticket password.</p>\n      </div>\n\n      <div class=\"item\">\n        <div class=\"hi-icon ion-ios-paper-outline\">&nbsp;</div>\n\n        <h4>\n          <a href=\"https://udora.io/production/index.php/en/142/blog_page/\">News &amp; Updates</a>\n        </h4>\n\n        <p>Be part of our journey and view the latest news and headlines from Udora. Stay up to date with our stories, videos,\n          photos and more.</p>\n      </div>\n\n      <div class=\"item\">\n        <div class=\"hi-icon ion-ios-list-outline\">&nbsp;</div>\n\n        <h4>\n          <a href=\"https://udora.io/production/index.php/en/182/terms_of_service/\">Key terms</a>\n        </h4>\n\n        <p>We&#39;re committed to your privacy and security. If you&rsquo;re not familiar with terms like cookies, IP addresses,\n          pixel tags and browsers find out here.</p>\n      </div>\n  </div>\n</div>', '', 'Help', NULL),
(1650, 175, 8, 'Help', 'Help', '', '', 'Help', NULL),
(1663, 1301, 1, 'Local Toronto events now live!', 'Blog', '<p><img alt=\"Ontario Place\" src=\"https://s3.amazonaws.com/btoimage/prism-thumbnails/articles/20171204-2048-WinterOntarioPlace2.jpg-resize_then_crop-_frame_bg_color_FFF-h_1365-gravity_center-q_70-preserve_ratio_true-w_2048_.jpg\" style=\"height: 533px; width: 800px;\" /></p>\n\n<p>Things to do in Toronto in winter&nbsp;are enough to entice those who believe it&#39;s the season to&nbsp;stay indoors&nbsp;to think otherwise. With skate parties, light festivals, highly anticipated events, activities&nbsp;and tons more, there are plenty of reasons to&nbsp;<a href=\"https://www.blogto.com/fashion_style/2014/12/the_top_25_stores_for_warm_winter_clothing_in_toronto/\">bundle up</a>&nbsp;and explore the city.</p>\n\n<h2>New This Year</h2>\n\n<p><strong>Skate Under the Gardiner Expressway</strong><br>\n\n<a href=\"http://www.blogto.com/events/bentway-gardiner-skating-path-toronto/\">A new skate trail called the Bentway</a>&nbsp;is opening up under the Gardiner that will connect 7 neighbourhoods together. Don&#39;t miss the&nbsp;<a href=\"http://www.blogto.com/events/bentway-gardiner-skating-path-toronto/\">official opening January 6</a>&nbsp;with food, DJs and entertainment. There will also be&nbsp;<a href=\"http://www.flip-publicity.com/wp-content/uploads/2017/12/The-Bentway-Friday-Night-Skate-Parties-rel.pdf\" target=\"_blank\">free skate parties</a>&nbsp;every Friday night.</p>\n\n<p><strong>Get lost in the Infinity Mirrors</strong></p>\n\n<p>Toronto is already in love with&nbsp;<a href=\"http://www.blogto.com/arts/2017/11/yayoi-kusama-infinity-mirrors-exhibit-toronto/\">Yayoi Kusama&rsquo;s Infinity Mirror Exhibit</a>, and the buzz will only get louder once it opens at the AGO on March 3.</p>\n\n<p><strong>See a winter light show at Ontario Place</strong></p>\n\n<p>Part of Ontario Place&rsquo;s recent rejuvenation movement includes an impressive and free&nbsp;<a href=\"http://www.blogto.com/events/winter-ontario-place-toronto/\">winter light exhibition</a>&nbsp;that&rsquo;s coupled with skating fire pits, and food vendors. It&#39;s open all winter long.</p>\n\n<p><strong>Celebrate your love of the Blue Jays</strong></p>\n\n<p><a href=\"http://www.blogto.com/events/winter-fest-2018-toronto-blue-jays-toronto/\">Winterfest&nbsp;on January 20</a>&nbsp;is a brand new, one day event giving&nbsp;fans access to the Jays&nbsp;like never before, with player appearances, guest speakers, Sportsnet personalities and more.</p>', 'Things to do in Toronto in winter are enough to entice those who believe it\'s the season to stay indoors to think otherwise. With skate parties, light festivals, highly anticipated events, activities and tons more, there are plenty of reasons to bundle up and explore the city.', '', NULL),
(1664, 1301, 8, 'Local Toronto Events', 'To', '', '', '', NULL),
(1743, 181, 1, 'How Udora works', 'How Udora works', '<section class=\"switchable switchable--switch imagebg height-60\" data-overlay=\"5\">\n<div class=\"background-image-holder\" style=\"background: url(\'assets/img/hero-sections/udora-howitworks-hero.jpg\'); opacity: 1;\"><img alt=\"background\" src=\"assets/img/hero-sections/udora-howitworks-hero.jpg\" /></div>\n\n<div class=\"container pos-vertical-center pt-6 pb-6\">\n<div class=\"row\">\n<div class=\"col-xs-12 col-md-8 text-center text-sm-left\">\n<h2 class=\"white-header size-54 weight-300 color-accent\">Explore more <span class=\"weight-600 color-white\">with Udora</span></h2>\n<a class=\"btn btn-circle size-14 btn-udora mb-1 mb-sm-0 mx-1 ml-md-0\" href=\"https://udora.io/production/index.php/frontend/register\">Sign up</a><button class=\"btn btn-circle size-14 btn-udora-white mb-1 mb-sm-0 mx-1\" data-fancybox=\"\" href=\"https://www.youtube.com/watch?v=vlDzYIIOYmM\">Video</button></div>\n</div>\n<!--end of row--></div>\n<!--end of container--></section>\n<!-- How It Works -->\n\n<div class=\"container pt-10 pb-10\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<div class=\"row d-md-flex align-items-md-center\">\n<div class=\"col-md-5\">\n<div class=\"how__works\">\n<div class=\"how__works__num\">\n<div class=\"num\"><span>1</span></div>\n</div>\n\n<div class=\"how__works__info\">\n<h6 class=\"how__works__info__title\">Search for events</h6>\n\n<p class=\"how__works__info__desc\">Select the city you want to search or use the locate me feature. Enter a keyword and Go!</p>\n</div>\n</div>\n\n<div class=\"how__works\">\n<div class=\"how__works__num\">\n<div class=\"num\"><span>2</span></div>\n</div>\n\n<div class=\"how__works__info\">\n<h6 class=\"how__works__info__title\">Join the community</h6>\n\n<p class=\"how__works__info__desc\">Sign up with email or social network, say a bit about yourself, post a photo and have fun.</p>\n</div>\n</div>\n\n<div class=\"how__works\">\n<div class=\"how__works__num\">\n<div class=\"num\"><span>3</span></div>\n</div>\n\n<div class=\"how__works__info\">\n<h6 class=\"how__works__info__title\">Make your voice heard</h6>\n\n<p class=\"how__works__info__desc\">Comment, comment, comment. Share your opinion, give feedback, explore and be proud.</p>\n</div>\n</div>\n</div>\n\n<div class=\"col-md-7\"><img alt=\"\" class=\"img-responsive\" src=\"assets/img/how-it-works/how-it-works-1.png\" /></div>\n</div>\n</div>\n</div>\n</div>\n<!-- Some Features-->\n\n<div class=\"container-color pad-tb-40 color\">\n<div class=\"container\">\n<div class=\"row marg30\">\n<div class=\"col-lg-4 col-md-4 col-sm-6 col-xs-12\">\n<div class=\"services-main\">\n<div class=\"other-serv marg0\">\n<div class=\"serv-icon\"><i class=\"ion-camera\"></i></div>\n\n<div class=\"serv-block-list\">\n<h2 class=\"serv-name\">Explore with Udora</h2>\n\n<p class=\"serv-desc weight-400\">Remainder household direction zealously the unwilling. Roused enabl estate old county females</p>\n</div>\n</div>\n</div>\n</div>\n\n<div class=\"col-lg-4 col-md-4 col-sm-6 col-xs-12\">\n<div class=\"services-main\">\n<div class=\"other-serv marg0\">\n<div class=\"serv-icon\"><i class=\"ion-ios-star-outline\"></i></div>\n\n<div class=\"serv-block-list\">\n<h2 class=\"serv-name\">Featured Events</h2>\n\n<p class=\"serv-desc weight-400\">Remainder household direction zealously the unwilling. Roused enabl estate old county females</p>\n</div>\n</div>\n</div>\n</div>\n\n<div class=\"col-lg-4 col-md-4 col-sm-12 col-xs-12\">\n<div class=\"services-main\">\n<div class=\"other-serv marg0\">\n<div class=\"serv-icon\"><i class=\"ion-ios-star\"></i></div>\n\n<div class=\"serv-block-list\">\n<h2 class=\"serv-name\">Reward Events</h2>\n\n<p class=\"serv-desc weight-400\">Remainder household direction zealously the unwilling. Roused enabl estate old county females</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n<!-- Found what you\'re looking -->\n\n<div class=\"container pt-10 pb-10\">\n<div class=\"row d-md-flex align-items-md-center\">\n<div class=\"col-md-7\"><img alt=\"\" class=\"img-responsive mb-5 mb-md-0\" src=\"assets/img/how-it-works/how-it-works-2.png\" /></div>\n\n<div class=\"col-md-5\">\n<h3 class=\"weight-300\">Explore with <span class=\"color-accent weight-600\">Udora?</span></h3>\n\n<div class=\"divider marg-l-0\">&nbsp;</div>\n\n<p class=\"marg-b-2\">Never miss another event. On Udora you can connect with event organizers, locals and explorers like yourself, get recommendations share photos or even meet up.</p>\n\n<p>Udora is your travel companion and will help you discover events near and far.</p>\n\n<p>Customize your search and use Udora to search for events by distance, category, date range, and event keywords.</p>\n<a class=\"btn btn-udora login-menu\" href=\"https://udora.io/production/index.php/frontend/register\">Sign up now</a></div>\n</div>\n</div>', '', 'How Udora works', NULL),
(1744, 181, 8, 'How Udora works', 'How Udora works', '', '', 'How Udora works', NULL),
(1745, 179, 1, 'About', 'About', '<section class=\"switchable switchable--switch imagebg height-60\" data-overlay=\"5\">\n<div class=\"background-image-holder\" style=\"background: url(\'assets/img/hero-sections/udora-about-hero.jpg\'); opacity: 1;\"><img alt=\"background\" src=\"assets/img/hero-sections/udora-about-hero.jpg\" /></div>\n\n<div class=\"container pos-vertical-center pt-6 pb-6\">\n<div class=\"row\">\n<div class=\"col-xs-12 col-md-8 text-center text-sm-left\">\n<h2 class=\"white-header size-54 weight-300 color-accent m-b-0-half\">Share experiences <span class=\"weight-600 color-white\">on Udora</span></h2>\n<a class=\"btn btn-circle size-14 btn-udora\" href=\"https://udora.io/production/index.php/en/181/how_udora_works/\">Learn More</a></div>\n</div>\n<!--end of row--></div>\n<!--end of container--></section>\n\n<div class=\"container-fluid split-layout\">\n<div class=\"clearfix\">\n<div class=\"col-xs-12 col-sm-6 col-md-6 split-image-block hidden-xs hidden-sm\">\n<div class=\"split-image-holder\" style=\"background-image:url(\'assets/img/about/s-1.jpg\')\">\n<div class=\"split-image-image\">&nbsp;</div>\n</div>\n</div>\n\n<div class=\"col-sm-8 col-sm-offset-2 col-md-offset-7 col-md-4 col-md-offset-7 split-content\">\n<h3 class=\"weight-300\">Our <span class=\"color-accent weight-600\">journey</span></h3>\n\n<p>On a short vacation, Anthony visited a local park where free samples of flavored water were being given out. So curious and thirsty, he accepted two flavors.</p>\n\n<p>The experience left him wanting to communicate with the drink company. He wanted an easy way to do this and thought maybe there was an app he could use. Since there was no such app, he knew he had to make one.</p>\n\n<p>He named our solution Udora, with the intention that you can have as much fun finding out about events and communicating with marketers as the childhood animated character &quot;Dora, the explorer.&quot;</p>\n\n<p>Udora has since expanded with the focus of helping you explore free events worldwide.</p>\n</div>\n</div>\n</div>\n\n<div class=\"container-fluid how-does-it-work\">\n<div class=\"clearfix\">\n<div class=\"col-md-12\">\n<div class=\"col-sm-6 col-md-4 hdiw-item\"><a href=\"https://udora.io/production/index.php/en/181/how_udora_works/\">\n<div class=\"hdiw-img\">\n<div class=\"hdiw-img-holder\" style=\"background-image:url(\'assets/img/about/hdiw-2-n.jpg\');\">&nbsp;</div>\n</div>\n\n<div class=\"hdiw-description\">\n<h3>Explore With UDora</h3>\n\n<p>Events, promotions and giveaways</p>\n</div>\n</a></div>\n\n<div class=\"col-sm-12 col-md-4 hdiw-item\"><a href=\"https://udora.io/production/index.php/en/180/udora_for_business/\">\n<div class=\"hdiw-img\">\n<div class=\"hdiw-img-holder\" style=\"background-image:url(\'assets/img/about/1.jpg\');\">&nbsp;</div>\n</div>\n\n<div class=\"hdiw-description\">\n<h3>UDora for Business</h3>\n\n<p>New product launch or promotion?</p>\n</div>\n</a></div>\n\n<div class=\"col-sm-6 col-md-4 hdiw-item special-item login-menu\"><a href=\"https://udora.io/production/index.php/frontend/register\">\n<div class=\"hdiw-img hdiw-special\">\n<div class=\"hdiw-img-holder\" style=\"background-image:url(\'assets/img/about/3a.jpg\');\">&nbsp;</div>\n</div>\n\n<div class=\"hdiw-description\">\n<h3>Join Us!</h3>\n\n<p>Create your profile and start exploring</p>\n</div>\n</a></div>\n</div>\n</div>\n</div>\n\n<div class=\"container-fluid split-layout\">\n<div class=\"clearfix\">\n<div class=\"col-sm-6 col-sm-offset-6 split-image-block hidden-xs hidden-sm\">\n<div class=\"split-image-holder\" style=\"background-image:url(\'assets/img/about/s-2.jpg\')\">\n<div class=\"split-image-image\">&nbsp;</div>\n</div>\n</div>\n\n<div class=\"col-sm-8 col-sm-offset-2 col-md-4 col-md-offset-1 split-content\">\n<h3 class=\"weight-300\">Hello to <span class=\"color-accent weight-600\">Udora</span></h3>\n\n<p>Udora is a simple way to explore the many free festivals, fairs, concerts, campaigns, and other promotional events on offer in most cities.</p>\n\n<p>Udora helps you locate these events in and around your city and offers you the option to give instant feedback.</p>\n\n<p>You can use Udora to take advantage of promotional offers and to find events at home or when traveling.</p>\n\n<p>Your personal information is never sold or given out, and both the website and mobile apps are free.</p>\n</div>\n</div>\n</div>\n\n<section class=\"p-t-4 p-b-4 bg-grey-darker\">\n<div class=\"container\">\n<h3 class=\"weight-300 text-center m-b-2\">Meet the<span class=\"color-accent weight-600\"> team</span></h3>\n\n<div class=\"row\">\n<div class=\"col-md-6 team__member\">\n<div class=\"team__member__img\"><img alt=\"Anhtony Boyington\" src=\"assets/img/about/Cowboy-Bebop.jpg\" /></div>\n\n<div><span class=\"team__member__title\">Anhtony Boyington - <span class=\"position\">Team leader</span></span>\n\n<p>Front and Back-end developer, art and visual director, cowboy bebop fanatic. Jack of many interests, master of some.</p>\n</div>\n</div>\n\n<div class=\"col-md-6 team__member\">\n<div class=\"team__member__img\"><img alt=\"Serhii Zharkov\" src=\"assets/img/about/serhii-zharkov.jpg\" /></div>\n\n<div><span class=\"team__member__title\">Serhii Zharkov - <span class=\"position\">Front-end Developer</span></span>\n\n<p>Serhii creates a scalable and modular architecture for every project and has an eye for professional designs. He is proficient with HTML, CSS, Javascript and uses best practices and cutting-edge technologies.</p>\n</div>\n</div>\n\n<div class=\"col-md-6 team__member\">\n<div class=\"team__member__img\"><img alt=\"Sandi Winter\" src=\"assets/img/about/sandi-winter.jpg\" /></div>\n\n<div><span class=\"team__member__title\">Sanljiljan Team - <span class=\"position\">Back-end Developer</span></span>\n\n<p>Multi-language is always in mind; their passion is coding innovative projects. This Europe based team\'s goal is to provide creative, customizable solutions.<br> https://codecanyon.net/user/sanljiljan</p>\n</div>\n</div>\n\n<div class=\"col-md-6 team__member\">\n<div class=\"team__member__img\"><img alt=\"Udora Supporters\" src=\"assets/img/about/our-supporters.jpg\" /></div>\n\n<div><span class=\"team__member__title\">Major Supporters</span>\n\n<div class=\"team__supporters\"><span>Terri Smith</span> <span>Carol Belmote</span> <span>Eddie Ho</span> <span>Leah Weisz</span> <span>Brandon Bonus Deenisha Doodnath</span> <span>Latoya Davis</span> <span>Jason Jones</span> <span>Alexandra Massie</span> <span>Hamid Adem</span> <span>Marlon Boyington</span> <span>Kosta Kotsaboikidis</span></div>\n</div>\n</div>\n</div>\n</div>\n</section>', '', 'About', NULL),
