(1757, 1, 1, 'Udora | Home', 'Home', '<!-- Features -->\n<div class=\"container marg50\">\n<div class=\"row\">\n<div class=\"col-lg-3 col-md-3 col-ms-12 col-sm-6 col-xs-6\">\n<div class=\"hi-icon-effect\">\n<div class=\"hi-icon ion-ios-crop\">&nbsp;</div>\n\n<div class=\"service-name\">Minimal Design</div>\n\n<div class=\"service-text\">Remainder household zealously the own unwilling roused escalate beautiful</div>\n</div>\n</div>\n\n<div class=\"col-lg-3 col-md-3 col-ms-12 col-sm-6 col-xs-6\">\n<div class=\"hi-icon-effect\">\n<div class=\"hi-icon ion-ios-clock-outline\">&nbsp;</div>\n\n<div class=\"service-name\">Powerful &amp; Flexible</div>\n\n<div class=\"service-text\">Remainder household zealously the own unwilling roused escalate beautiful</div>\n</div>\n</div>\n\n<div class=\"col-lg-3 col-md-3 col-ms-12 col-sm-6 col-xs-6\">\n<div class=\"hi-icon-effect\">\n<div class=\"hi-icon ion-ios-pie-outline\">&nbsp;</div>\n\n<div class=\"service-name\">Love Our Clients</div>\n\n<div class=\"service-text\">Remainder household zealously the own unwilling roused escalate beautiful</div>\n</div>\n</div>\n\n<div class=\"col-lg-3 col-md-3 col-ms-12 col-sm-6 col-xs-6\">\n<div class=\"hi-icon-effect\">\n<div class=\"hi-icon ion-ios-star-outline\">&nbsp;</div>\n\n<div class=\"service-name\">Premium Support</div>\n\n<div class=\"service-text\">Remainder household zealously the own unwilling roused escalate beautiful</div>\n</div>\n</div>\n</div>\n</div>\n<!-- Features -->', '', '', NULL),
(1758, 1, 8, 'Početna', 'Početna', '<div class=\"row\">\n<div class=\"span1\"><img src=\"assets/img/multilangual.png\" /></div>\n\n<div class=\"span3\">\n<h4>Native Multilangual</h4>\nNatively multilingual, no need to install any addon. Every element can be translated and you can add as many languages as you want.</div>\n\n<div class=\"span1\"><img src=\"assets/img/easy_customize.png\" /></div>\n\n<div class=\"span3\">\n<h4>Easy to customize</h4>\nApplication is based on CodeIgniter PHP framework, if you know CodeIgniter you can easily customize the system.</div>\n\n<div class=\"span1\"><img src=\"assets/img/bootstrap.png\" /></div>\n\n<div class=\"span3\">\n<h4>Bootstrap ready</h4>\nBackend and Frontend based on Bootstrap and are easy to customize.</div>\n</div>\n\n<div class=\"row\">\n<div class=\"span1\"><img src=\"assets/img/drag-drop.png\" /></div>\n\n<div class=\"span3\">\n<h4>User friendly</h4>\nWebsite structure is logical. Managing elements such as pages, estates or images is easily done by drag&#39;n&#39;drop!</div>\n\n<div class=\"span1\"><img src=\"assets/img/template.png\" /></div>\n\n<div class=\"span3\">\n<h4>Template System</h4>\nEasy to use CodeIgniter Template Parser Class or alternative PHP syntax available.</div>\n\n<div class=\"span1\"><img src=\"assets/img/robust.png\" /></div>\n\n<div class=\"span3\">\n<h4>Robust</h4>\nBuild as easy to use and robust Metro style Admin user interface</div>\n</div>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', '', '', NULL),
(1759, 6, 1, 'Udora | Events', 'Events', '<div class=\"row\">\n<div class=\"span1\"><img src=\"assets/img/multilangual.png\" /></div>\n\n<div class=\"span3\">\n<h4>Native Multilangual</h4>\nNatively multilingual, no need to install any addon. Every element can be translated and you can add as many languages as you want.</div>\n\n<div class=\"span1\"><img src=\"assets/img/easy_customize.png\" /></div>\n\n<div class=\"span3\">\n<h4>Easy to customize</h4>\nApplication is based on CodeIgniter PHP framework, if you know CodeIgniter you can easily customize the system.</div>\n\n<div class=\"span1\"><img src=\"assets/img/bootstrap.png\" /></div>\n\n<div class=\"span3\">\n<h4>Bootstrap ready</h4>\nBackend and Frontend based on Bootstrap and are easy to customize.</div>\n</div>\n\n<div class=\"row\">\n<div class=\"span1\"><img src=\"assets/img/drag-drop.png\" /></div>\n\n<div class=\"span3\">\n<h4>User friendly</h4>\nWebsite structure is logical. Managing elements such as pages, estates or images is easily done by drag&#39;n&#39;drop!</div>\n\n<div class=\"span1\"><img src=\"assets/img/template.png\" /></div>\n\n<div class=\"span3\">\n<h4>Template System</h4>\nEasy to use CodeIgniter Template Parser Class or alternative PHP syntax available.</div>\n\n<div class=\"span1\"><img src=\"assets/img/robust.png\" /></div>\n\n<div class=\"span3\">\n<h4>Robust</h4>\nBuild as easy to use and robust Metro style Admin user interface</div>\n</div>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', '', 'Map, events', NULL),
(1760, 6, 8, 'Karta', 'Karta', '<div class=\"row\">\n<div class=\"span1\"><img src=\"assets/img/multilangual.png\" /></div>\n\n<div class=\"span3\">\n<h4>Native Multilangual</h4>\nNatively multilingual, no need to install any addon. Every element can be translated and you can add as many languages as you want.</div>\n\n<div class=\"span1\"><img src=\"assets/img/easy_customize.png\" /></div>\n\n<div class=\"span3\">\n<h4>Easy to customize</h4>\nApplication is based on CodeIgniter PHP framework, if you know CodeIgniter you can easily customize the system.</div>\n\n<div class=\"span1\"><img src=\"assets/img/bootstrap.png\" /></div>\n\n<div class=\"span3\">\n<h4>Bootstrap ready</h4>\nBackend and Frontend based on Bootstrap and are easy to customize.</div>\n</div>\n\n<div class=\"row\">\n<div class=\"span1\"><img src=\"assets/img/drag-drop.png\" /></div>\n\n<div class=\"span3\">\n<h4>User friendly</h4>\nWebsite structure is logical. Managing elements such as pages, estates or images is easily done by drag&#39;n&#39;drop!</div>\n\n<div class=\"span1\"><img src=\"assets/img/template.png\" /></div>\n\n<div class=\"span3\">\n<h4>Template System</h4>\nEasy to use CodeIgniter Template Parser Class or alternative PHP syntax available.</div>\n\n<div class=\"span1\"><img src=\"assets/img/robust.png\" /></div>\n\n<div class=\"span3\">\n<h4>Robust</h4>\nBuild as easy to use and robust Metro style Admin user interface</div>\n</div>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', '', 'Map', NULL);
