(2108, NULL, 'E0-001-115853011-8', '43.6327076, -79.4213438', '43.632708', '-79.421344', '2018-07-30 17:34:53', '2018-07-30 17:34:53', NULL, '190 Princes\' Boulevard, Toronto, Ontario', NULL, 6597, 0, 'id: 2108 190 Princes\' Boulevard, Toronto, Ontario         Canada Canada   Toronto Toronto Join us for the Canadian Premiere of Girls Always Happy and on-stage panel talk! Girls Always Happy portrays a single mother living with her daughter in a Beijing hutong. Looking at the contemporary urban life with a novel perspective, Girls Always Happy represents the spectacle of mutual repulsion, hatred, and harm between a single mother and her daughter, and yet from their despair rises the power of tender love. The complexity indicates the unique observation and expression of the director YANG Mingming on female relationships. 影片以全新的视角面对当代城市生活，以“令人震惊的准确度”刻画了北京胡同中一对单亲家庭母女互相拒斥、仇恨、伤害的奇观，在绝望中折射出柔情的力量。 Credits 演职员名单 Director 导演：YANG Mingming 杨明明 Principal Cast 主演：NAI An 耐安、YANG Mingming 杨明明 Producer 制片人：YANG Jing 杨竞 Screenplay 编剧：YANG Mingming 杨明明 Cinematographer 摄影：SHEN Xiaomin 沈晓闽 Editor 剪辑：YANG Mingming 杨明明 Join us for the Canadian Premiere of Girls Always Happy and on-stage panel talk! Girls Always Happy portrays a single mother living with her daughter in a Beijing hutong. Looking at the contemporary urban life with a novel perspective, Girls Always Happy represents the spectacle of mutual repulsion, hatred, and harm between a single mother and her daughter, and yet from their despair rises the power of tender love. The complexity indicates the unique observation and expression of the director YANG Mingming on female relationships. 影片以全新的视角面对当代城市生活，以“令人震惊的准确度”刻画了北京胡同中一对单亲家庭母女互相拒斥、仇恨、伤害的奇观，在绝望中折射出柔情的力量。 Credits 演职员名单 Director 导演：YANG Mingming 杨明明 Principal Cast 主演：NAI An 耐安、YANG Mingming 杨明明 Producer 制片人：YANG Jing 杨竞 Screenplay 编剧：YANG Mingming 杨明明 Cinematographer 摄影：SHEN Xiaomin 沈晓闽 Editor 剪辑：YANG Mingming 杨明明   Canadian Premiere: Girls Always Happy 柔情史 - MulanIFF Canadian P