(2109, NULL, 'E0-001-115853010-9', '43.6327976, -79.4212738', '43.632798', '-79.421274', '2018-07-30 17:34:58', '2018-08-21 08:17:30', NULL, '190 Princes Boulevard, Toronto, Ontario', NULL, 6599, 1, 'id: 2109190 Princes Boulevard, Toronto, Ontario North American Premiere: Bangzi Melody 村戏 - MulanIFF Join us for the North American Premiere of Bangzi Melody and on-stage panel talk! In the 1980s, with the end of the Cultural Revolution, China has begun a vast land reform in its rural area to launch the so-called household-responsibility system, which aims at ending the egalitarian distribution method performed in Maoist China. In 1982, in a village in Northern China, Kuisheng, the mad man of the village had been in charge of the best peanut field for a long time. Once the reform began, his land was coveted by the villagers who tried to prove that he was not qualified enough to keep such precious property. With the Spring Festival approaching, Party Secretary Wang asked all villagers to rehearse “Beating Princess”, a classic piece of Hebei Bangzi (traditional wooden clapper opera). Uncle Lu, the Opera leader nominated his daughter Xiaofen to play the role of the princess. Xiaofen, in love with Shuman, the son of Kuisheng, tried her best to fulfill the task and to persuade everyone that Kuisheng was not insane. The rehearsal was intertwined with the final negotiation of land-dividing, which would have a great influence on the future life of every villager. Is Kuisheng a lunatic or a saint, a victim or a hero? Shot in black and white with great humanistic spirit, Bangzi Melody recounts the Chinese land reform full of personal sufferings, political gambling, and historical ambiguities. 82年农村。包产到户前。 王支书要村里恢复演出老戏。“戏篓子”路老鹤，安排杨志刚演男主角，女儿路小芬不情愿。 女儿的意中是奎疯子的儿子王树满。 奎疯子和霸占了十年的“九亩半”成了“分地”的焦点。“唱戏”“分地”交织中，牵出一段历史悲剧。 Credits 演职员名单 Director 导演：ZHENG Dasheng 郑大圣 Executive Producer 执行制片人：ZHU Bin 朱斌 Original Novel 小说原著：JIA Dashan 贾大山 Screenplay 编剧：LI Baoluo 李保罗 Cinematographer 摄影：SHAO Dan 邵丹