(2110, NULL, 'E0-001-115852994-5', '43.6655826, -79.3995009', '43.665583', '-79.399501', '2018-07-30 17:35:00', '2018-08-21 08:17:04', NULL, '2 Sussex Avenue, Toronto, Ontario', NULL, 6601, 1, 'id: 21102 Sussex Avenue, Toronto, Ontario North American Premiere: I’ve Got A Little Problem 我有一个忧郁的，小问题 - MulanIFF Join us for the North American Premiere of I’ve Got A Little Problem! Known for shooting nude photos of Chinese youth and his explicit representation of Chinese sexuality, REN Hang sought to photograph a group of nude models in the streets of Beijing. However, as always, his shooting plan received biased criticism and encountered problems with the law. Facing an ongoing battle with manic depression added inconceivable difficulty to an already troublesome existence. Ultimately, he ended his young life. 摄影师兼诗人任航有一个拍摄计划：在鼓楼大街上拍摄裸体模特。但是这似乎是一件不可能做到的事情。自拍摄裸体伊始，他就一直面临多方阻力，从被印刷厂老板诈骗的无处申诉，到被举报拍摄裸体让警察带走……而自高中开始，任航便展现出抑郁的苗头。当饱受抑郁困扰的任航决心完成一件极具艰难的作品时，他似乎遭遇了个人生活和创作的两重困境。 Credits 演职员名单 Director 导演：ZHANG Ximing 张溪溟 Producer 制片人：ZHANG Ximing 张溪溟 Cinematographer 摄影：ZHANG Ximing 张溪溟 Editor 剪辑：ZHANG Ximing 张溪溟  empty Default Events Park Arts   Festivals -  2018-08-11 02:45 PM 2018-08-18 02:45 PM Canada Toronto M5S 1J5 Less than 50m2  -       Agent            http://toronto.eventful.com/venues/innis-town-hall-/V0-001-011893057-1?utm_source=apis&amp;amp;utm_medium=apim&amp;amp;utm_campaign=apic                  North American Premiere: I’ve Got A Little Problem 我有一个忧郁的，小问题 - MulanIFF Join us for the North American Premiere of I’ve Got A Little Problem! Known for shooting nude photos of Chinese youth and his explicit representation of Chinese sexuality, REN Hang sought to photograph a group of nude models in the streets of Beijing. However, as always, his shooting plan received biased criticism and encountered problems with the law. Facing an ongoing battle with manic depression added inconceivable difficulty to an already troublesome existence. Ultimately, he ended his young life. 摄影