(2111, NULL, 'E0-001-115852997-2', '43.6655626, -79.3994809', '43.665563', '-79.399481', '2018-07-30 17:35:03', '2018-08-21 08:16:36', NULL, '2 Sussex Avenue, Toronto, Ontario', NULL, 6603, 1, 'id: 21112 Sussex Avenue, Toronto, Ontario Canadian Premiere: Artes Liberales 大学之道 - Mulan International Film Festival Join us for the Canadian Premiere of Artes Liberales and on-stage panel talk! Premiered at the 2018 China Education Symposium at Harvard University, this documentary film explores the concept of “liberal arts education” and the perceptions of how international students from feel about the liberal arts education system in the US. It brings a blend of interviews with professors, scholars, parents and students, discussing the academic challenges these Chinese students may face when they pursue higher education in the US. 《大学之道》以哈佛大学教育学院的毕业研究生为主要采访对象，展开了对博雅教育的概念和意义的探讨，并记录下了中国留学生在美国求学时面对的主要碰撞、在文化差异中的成长，以及他们在理念和视野上的变化。任何一位留学海外的中国学生，或许都能在采访分享中看到似曾相识的经历——那些如何找到自我、找到出路，以及怎样分辨善恶，又怎样做出选择的种种过往或如今。本片在2018年4月的哈佛中国教育论坛上举行首映，引起了教育学者、师生和家长的极大反响。 Credits 演职员名单 Director 导演：CHEN Ceng 陈层 Producer 制片人：CHEN Ceng 陈层、Joe JIAO 焦念韬、Starry ZHU 朱晓薇 Cinematographer 摄影： CHEN Ceng 陈层、LI Hongyi 李弘毅 Editor 剪辑：CHEN Ceng 陈层 Sound 音效：Jared AMBROSE、CHEN Ceng 陈层  empty Default Events Park Arts   Festivals -  2018-08-11 05:00 PM 2018-08-18 05:00 PM Canada Toronto M5S 1J5 Less than 50m2  -       Agent            http://toronto.eventful.com/venues/innis-town-hall-/V0-001-011893057-1?utm_source=apis&amp;amp;utm_medium=apim&amp;amp;utm_campaign=apic                  Canadian Premiere: Artes Liberales 大学之道 - Mulan International Film Festival Join us for the Canadian Premiere of Artes Liberales and on-stage panel talk! Premiered at the 2018 China Education Symposium at Harvard University, this documentary film explores the concept of “liberal arts education” and the perceptions of how international students from feel about the liberal arts education system in the US. It brings a blend of interviews with p