(2118, NULL, 'E0-001-113299124-9@2018092213', '43.6817068, -79.3916378', '43.681707', '-79.391638', '2018-09-11 22:31:03', '2018-09-11 22:31:03', NULL, '1208 Yonge St, Toronto, Ontario', NULL, 6625, 0, 'id: 2118 1208 Yonge St, Toronto, Ontario         Canada Canada   Toronto Toronto Coffee is, to us, so much more than caffeination. It’s a window into regions to which we cannot always travel, and into the lives of people we cannot always meet. It brings close what is physically distant: agriculture from Africa to South America, roasters from Oregon to Scandinavia. It’s a triumph of science, and a question to which there will never be a satisfying answer. We believe that, through coffee, you can see the world. Every Saturday we cup samples of new coffees that may or may not make it to the Boxcar menu the following week. Come be a part of the selection process, and learn about different coffees from around the world with our team of experts.  Coffee is, to us, so much more than caffeination. It’s a window into regions to which we cannot always travel, and into the lives of people we cannot always meet. It brings close what is physically distant: agriculture from Africa to South America, roasters from Oregon to Scandinavia. It’s a triumph of science, and a question to which there will never be a satisfying answer. We believe that, through coffee, you can see the world. Every Saturday we cup samples of new coffees that may or may not make it to the Boxcar menu the following week. Come be a part of the selection process, and learn about different coffees from around the world with our team of experts.    Coffee Cupping at Boxcar Summerhill Coffee Cupping at Boxcar Summerhill     Coffee is, to us, so much more than caffeination. It’s a window into regions to which we cannot always travel, and into the lives of people we cannot always meet. It brings close what is physically distant: agriculture from Africa to South America, roasters from Oregon to Scandinavia. It’s a triumph of science, and a question to which there will never be a satisfying answer. We believe that, through coffee, you can see the world. Every Saturday we cup samples of new coffees that may or may not make it to the Boxcar menu the following week. Come be a part of the selection process, and learn about different coffees from around the world with our team of experts.  Coffee is, to us, so much more than caffeination. It’s a window into regions to which we cannot always travel, and into the lives of people we cannot always meet. It brings close what is physically distant: agriculture from Africa to South America, roasters from Oregon to Scandinavia. It’s a triumph of science, and a question to which there will never be a satisfying answer. We believe that, through coffee, you can see the world. Every Saturday we cup samples of new coffees that may or may not make it to the Boxcar menu the following week. Come be a part of the selection process, and learn about different coffees from around the world with our team of experts.                                      M4T 1W1 M4T 1W1                                                 http://toronto.eventful.com/venues/boxcar-social-/V0-001-007901289-7?utm_source=apis&amp;amp;utm_medium=apim&amp;amp;utm_campaign=apic http://toronto.eventful.com/venues/boxcar-social-/V0-001-007901289-7?utm_source=apis&amp;amp;utm_medium=apim&amp;amp;utm_campaign=apic                 Food &amp; Wine - Food &amp; Wine - 2018-09-22 13:00:00 2018-09-22 13:00:00 2018-09-29 13:00:00 2018-09-29 13:00:00   8', 1, 1, NULL, NULL, 58, NULL, '[]', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '198.84.189.182', NULL),
(2119, NULL, 'E0-001-111595271-1@2018091409', '43.6655, -79.4721', '43.665500', '-79.472100', '2018-09-11 22:31:03', '2018-09-11 22:31:03', NULL, '3079 Dundas St W, Toronto, Ontario', NULL, 6627, 0, 'id: 2119 3079 Dundas St W, Toronto, Ontario         Canada Canada   Toronto Toronto On this all-day tour, enjoy an intimate experience of the wines of Prince Edward County. This region has been garnering fame and recognition locally and worldwide over the past decade. Wines with impeccable mineral quality, great sparkling wines, and a gorgeous country side are the draws which will have you wanting to return again and again. Learn about the region and what makes it special as you drive along the picturesque shore of Lake Ontario. Then over the course of the afternoon, visit three charming wineries with hands-on attention from your guide, a WSET certified wine-lover, as well as the vineyard personal and winemakers. Around mid-day, pizza lunch on the patio will be taken at Norman Hardie&amp;amp;#39;s award winning vineyard. After pickup from your accommodation in Toronto between 8:30am and 9am, journey to Prince Edward County for the day.  INSERT INTO `property_lang` (`l_id`, `property_id`, `language_id`, `json_object`, `field_36_int`, `field_37_int`, `field_55_int`, `field_19_int`, `field_20_int`, `field_58_int`, `field_57_int`, `field_56_int`, `field_59_int`, `field_4`, `field_2`, `field_5`, `field_7`, `field_81_int`, `field_82_int`) VALUES
(5485, 2086, 8, '{\"field_1\":\"\",\"field_2\":\"\",\"field_3\":\"\",\"field_4\":\"\",\"field_5\":\"Canada\",\"field_6\":\"\",\"field_7\":\"Toronto\",\"field_8\":\"Whether you’re a craft beer newbie or a seasoned imbiber… a tour through Big Rock Brewery, Canada’s leading craft brewery, is a great way to spend some of your valued time in Ontario. In fact, consider it an investment in DELICIOUS! Led by a TEAM of beer passionate folks who live, love and drink craft beer, enjoy a 60-minute brewery tour and tasting. You&amp;amp;#39;ll follow our state-of-the-art brewing process with your own eyes, ears and nose, from the unloading of ingredients, through the brewing and fermentation stages, all the way to the packaging facility. Before you head home, you&amp;amp;#39;ll experience a Big Rock tasting session where you get to sample the latest and greatest on tap.  Tours take place every Saturday at 1pm and 4pm.  Large group private tour packages are available for booking – please email info.bro@bigrockbeer.com for more details. Big Rock Brewery Store Hours  Monday- CLOSED Tuesday- CLOSED Wednesday, Thursday and Friday: 4:00pm - 8:00pm Saturday: 11:00am - 7:00pm Sunday: 1:00pm - 5:00pm Any Questions or concerns please contact 647.351.7837 ***FAQs***  Are there ID requirements or an age limit to enter the event? Participants must be 19 years of age or older with valid identification.    What can\\/can&amp;amp;#39;t I bring to the event? PLEASE BRING: Government photo ID (required to participate in sampling of beer) PLEASE DO NOT BRING: Outside alcohol. Anyone arriving on premise that appears to be impaired will be unable to participate in our brewery tours.   Do I have to bring my printed ticket to the event? No. Since you will have your ID with you, we can verify your identity that way. No need to print anything out!\",\"field_9\":\"\",\"field_10\":\"Etobicoke: Big Rock Brewery Tour\",\"field_11\":\"\",\"field_12\":\"\",\"field_17\":\"Whether you’re a craft beer newbie or a