(5513, 2100, 8, '{\"field_1\":\"\",\"field_2\":\"\",\"field_3\":\"\",\"field_4\":\"\",\"field_5\":\"Canada\",\"field_6\":\"\",\"field_7\":\"Toronto\",\"field_8\":\"The focus of this class is the science behind brewing coffee, starting with the fundamental principles of extraction and ending in a deeper exploration into the application of these principles. In this workshop we also demonstrate a variety of popular brewing methods and equipment while examining their pros and cons. This coffee lecture is led by Merchants of Green Coffee&amp;amp;#39;s CEO and aims to be a source of unbiased information learned throughout the company&amp;amp;#39;s 20-year history of sourcing and marketing certified green coffees while helping pioneer innovative off-grid coffee production programs, and educate consumers about coffee quality.In no way a sales pitch, this lecture is full of little-known coffee information that&amp;amp;#39;s chosen with discretion and delivered in a way that is uniquely raw and witty. This class has been running and improving for more than 10 years now and is attended by many different people of varying coffee knowledge; from everyday coffee drinkers, to people who work in coffee or are interested in entering the industry, writers, professors, foodies, curious consumers, and so on.At the end of the workshop the floor is opened up for 30 minutes of questions and discussion, and yes, fresh brewed coffee is served at the start!   FAQs   How can I contact the organizer with any questions? Please direct any questions about this coffee lecture to merchantsofgreencoffee@gmail.com  \",\"field_9\":\"\",\"field_10\":\"Coffee Lecture: Alchemy of Brewing\",\"field_11\":\"\",\"field_12\":\"\",\"field_17\":\"The focus of this class is the science behind brewing coffee, starting with the fundamental principles of extraction and ending in a deeper exploration into the application of these principles. In this workshop we also demonstrate a variety of popular brewing methods a