l.com\\/venues\\/merchants-of-green-coffee-\\/V0-001-004460113-0?utm_source=apis&amp;amp;utm_medium=apim&amp;amp;utm_campaign=apic\",\"field_70\":\"\",\"field_71\":\"\",\"field_72\":\"\",\"field_73\":\"\",\"field_74\":\"\",\"field_76\":\"\",\"field_77\":\"\",\"field_78\":\"\",\"field_79\":\"Food &amp; Wine -\",\"field_81\":\"2018-11-17 10:00:00\",\"field_82\":\"2018-11-24 10:00:00\",\"field_83\":\"\"}', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', 'Canada', 'Toronto', '2018-11-17 10:00:00', '2018-11-24 10:00:00'),
(5527, 2107, 8, '{\"field_1\":\"\",\"field_2\":\"\",\"field_3\":\"\",\"field_4\":\"\",\"field_5\":\"Canada\",\"field_6\":\"\",\"field_7\":\"Toronto\",\"field_8\":\"Every spring, China’s cities are plunged into chaos, as all at once, a tidal wave of humanity attempts to return home by train. It is the Chinese New Year. The wave is made up of millions of migrant factory workers. The homes they seek are the rural villages and families they left behind to seek work in the booming coastal cities. It is an epic spectacle that tells us much about China, a country discarding traditional ways as it hurtles towards modernity and global economic dominance. Last Train Home, an emotionally engaging and visually beautiful debut film from Chinese-Canadian director Lixin Fan, draws us into the fractured lives of a single migrant family caught up in this desperate annual migration. Sixteen years ago, the Zhangs abandoned their young children to find work in the city, consoled by the hope that their wages would lift their children into a better life. But in a bitter irony, the Zhangs’ hopes for the future are undone by their very absence. Qin, the child they left behind, has grown into adolescence crippled by a sense of abandonment. In an act of teenage rebellion, she drops out of school. She too will become a migrant worker. The decision is a heartbreaking blow for the parents. In classic cinema verité style, Last Train Homefollows the Zhangs’ attempts to change their daughter’s course and repair their ruptured family. Intimate and candid, the film paints a human portrait of the dramatic changes sweeping China. We identify with the Zhangs as they navigate through the stark and difficult choices of a society caught between old ways and new realities. Can they get ahead and still undo some of the damage that has been done to their family? Credits 演职员名单 Director 导演：FAN Lixin 范立欣 Producer 制片人：Mila AUNG-THWIN, Daniel CROSS Cinematographer 摄影：FAN Lixin 范立欣 Editor 剪辑：FAN Lixin 范立欣、Mary STE