(5529, 2108, 8, '{\"field_1\":\"\",\"field_2\":\"\",\"field_3\":\"\",\"field_4\":\"\",\"field_5\":\"Canada\",\"field_6\":\"\",\"field_7\":\"Toronto\",\"field_8\":\"Join us for the Canadian Premiere of Girls Always Happy and on-stage panel talk! Girls Always Happy portrays a single mother living with her daughter in a Beijing hutong. Looking at the contemporary urban life with a novel perspective, Girls Always Happy represents the spectacle of mutual repulsion, hatred, and harm between a single mother and her daughter, and yet from their despair rises the power of tender love. The complexity indicates the unique observation and expression of the director YANG Mingming on female relationships. 影片以全新的视角面对当代城市生活，以“令人震惊的准确度”刻画了北京胡同中一对单亲家庭母女互相拒斥、仇恨、伤害的奇观，在绝望中折射出柔情的力量。 Credits 演职员名单 Director 导演：YANG Mingming 杨明明 Principal Cast 主演：NAI An 耐安、YANG Mingming 杨明明 Producer 制片人：YANG Jing 杨竞 Screenplay 编剧：YANG Mingming 杨明明 Cinematographer 摄影：SHEN Xiaomin 沈晓闽 Editor 剪辑：YANG Mingming 杨明明\",\"field_9\":\"\",\"field_10\":\"Canadian Premiere: Girls Always Happy 柔情史 - MulanIFF\",\"field_11\":\"\",\"field_12\":\"\",\"field_17\":\"Join us for the Canadian Premiere of Girls Always Happy and on-stage panel talk! Girls Always Happy portrays a single mother living with her daughter in a Beijing hutong. Looking at the contemporary urban life with a novel perspective, Girls Always Happy represents the spectacle of mutual repulsion, hatred, and harm between a single mother and her daughter, and yet from their despair rises the power of tender love. The complexity indicates the unique observation and expression of the director YANG Mingming on female relationships. 影片以全新的视角面对当代城市生活，以“令人震惊的准确度”刻画了北京胡同中一对单亲家庭母女互相拒斥、仇恨、伤害的奇观，在绝望中折射出柔情的力量。 Credits 演职员名单 Director 导演：YANG Mingming 杨明明 Principal Cast 主演：NAI An 耐安、YANG Mingming 杨明明 Producer 制片人：YANG Jing 杨竞 Screenplay 编剧：YANG Mingming 杨明明 Cinematographer 摄影：SHEN Xiaomin 沈晓闽 Editor 剪辑：YANG Mingming 杨明明\",\"field_19\":\"\",\"field_20\":\"\",\"field_21\":\"\