(5539, 2110, 1, '{\"field_10\":\"North American Premiere: I’ve Got A Little Problem 我有一个忧郁的，小问题 - MulanIFF\",\"field_8\":\"Join us for the North American Premiere of I’ve Got A Little Problem! Known for shooting nude photos of Chinese youth and his explicit representation of Chinese sexuality, REN Hang sought to photograph a group of nude models in the streets of Beijing. However, as always, his shooting plan received biased criticism and encountered problems with the law. Facing an ongoing battle with manic depression added inconceivable difficulty to an already troublesome existence. Ultimately, he ended his young life. 摄影师兼诗人任航有一个拍摄计划：在鼓楼大街上拍摄裸体模特。但是这似乎是一件不可能做到的事情。自拍摄裸体伊始，他就一直面临多方阻力，从被印刷厂老板诈骗的无处申诉，到被举报拍摄裸体让警察带走……而自高中开始，任航便展现出抑郁的苗头。当饱受抑郁困扰的任航决心完成一件极具艰难的作品时，他似乎遭遇了个人生活和创作的两重困境。 Credits 演职员名单 Director 导演：ZHANG Ximing 张溪溟 Producer 制片人：ZHANG Ximing 张溪溟 Cinematographer 摄影：ZHANG Ximing 张溪溟 Editor 剪辑：ZHANG Ximing 张溪溟\",\"field_17\":\"<p>Join us for the North American Premiere of&nbsp;I&rsquo;ve Got A Little Problem! Known for shooting nude photos of Chinese youth and his explicit representation of Chinese sexuality, REN Hang sought to photograph a group of nude models in the streets of Beijing. However, as always, his shooting plan received biased criticism and encountered problems with the law. Facing an ongoing battle with manic depression added inconceivable difficulty to an already troublesome existence. Ultimately, he ended his young life. 摄影师兼诗人任航有一个拍摄计划：在鼓楼大街上拍摄裸体模特。但是这似乎是一件不可能做到的事情。自拍摄裸体伊始，他就一直面临多方阻力，从被印刷厂老板诈骗的无处申诉，到被举报拍摄裸体让警察带走&hellip;&hellip;而自高中开始，任航便展现出抑郁的苗头。当饱受抑郁困扰的任航决心完成一件极具艰难的作品时，他似乎遭遇了个人生活和创作的两重困境。 Credits&nbsp;演职员名单 Director 导演：ZHANG Ximing 张溪溟 Producer 制片人：ZHANG Ximing 张溪溟 Cinematographer 摄影：ZHANG&nbsp;Ximing 张溪溟 Editor 剪辑：ZHANG Ximing 张溪溟<\\/p>\",\"field_78\":\"\",\"field_38\":\"empty\",\"field_6\":\"Default Events\",\"field_2\":\"Park\",\"field_4\":\"Arts\",\"field_76\":\"\",\"field_56\":\"\",\"field_79\":\"Festivals -\",\"field_1\":\"\",\"field_81\":\