(5545, 2113, 8, '{\"field_1\":\"\",\"field_2\":\"\",\"field_3\":\"\",\"field_4\":\"\",\"field_5\":\"Canada\",\"field_6\":\"\",\"field_7\":\"Toronto\",\"field_8\":\"Think French baking is complicated? Actually, it&amp;amp;#39;s a jeu d&amp;amp;#39;enfant - so easy even kids can create beautiful desserts!  Join Mardi Michels author the upcoming &amp;amp;quot;In the French Kitchen with Kids&amp;amp;quot; (Appetite by Random House July 2018) in the kitchen to learn how to cook some classic French sweet treats with your child in this interactive class. In this class, you and your child will learn to make: Madeleines: Shell-shaped sponge cakes with a lemon glaze; Mini tartes aux fruits: Melt-in-your-mouth pastry topped with crème pâtissière and fresh fruits; Langues de Chat: Thin, crunchy cookies shaped like cat’s tongues; Chocolate Coeur à la Crème:  a classic French dessert, so easy you’ll want to make it even on a weeknight Class is suitable for children 7-14. Children must be accompanied by at least one adult. Single adult or child tickets may only be purchased as additions to at least one adult\\/child ticket combo. This class requires a minimum of 8 adult\\/child pairs to run. ***Please note – no refund for cancellations made after September 23rd 2018. Tickets are transferable only after that date.\",\"field_9\":\"\",\"field_10\":\"French Baking for Kids: A parent-child cooking class\",\"field_11\":\"\",\"field_12\":\"\",\"field_17\":\"Think French baking is complicated? Actually, it&amp;amp;#39;s a jeu d&amp;amp;#39;enfant - so easy even kids can create beautiful desserts!  Join Mardi Michels author the upcoming &amp;amp;quot;In the French Kitchen with Kids&amp;amp;quot; (Appetite by Random House July 2018) in the kitchen to learn how to cook some classic French sweet treats with your child in this interactive class. In this class, you and your child will learn to make: Madeleines: Shell-shaped sponge cakes with a lemon glaze; Mini tartes aux fruits: Melt-in-your-mouth pastry topped with crème pâtissière and fresh fruits; Langues de Chat: Thin, crunchy cookies shaped like cat’s tongues; Chocolate Coeur à la Crème:  a classic French dessert, so easy you’ll want to make it even on a weeknight Class is suitable for children 7-14. Children must be accompanied by at least one adult. Single adult or child tickets may only be purchased as additions to at least one adult\\/child ticket combo. This class requires a minimum of 8 adult\\/child pairs to run. ***Please note – no refund for cancellations made after September 23rd 2018. Tickets are transferable only after that date.\",\"field_19\":\"\",\"field_20\":\"\",\"field_21\":\"\",\"field_22\":\"\",\"field_23\":\"\",\"field_24\":\"\",\"field_25\":\"\",\"field_27\":\"\",\"field_28\":\"\",\"field_29\":\"\",\"field_30\":\"\",\"field_31\":\"\",\"field_32\":\"\",\"field_33\":\"\",\"field_36\":\"\",\"field_37\":\"\",\"field_38\":\"\",\"field_39\":\"\",\"field_40\":\"M5E 1C2\",\"field_42\":\"\",\"field_43\":\"\",\"field_44\":\"\",\"field_45\":\"\",\"field_46\":\"\",\"field_47\":\"\",\"field_48\":\"\",\"field_49\":\"\",\"field_50\":\"\",\"field_51\":\"\",\"field_52\":\"\",\"field_53\":\"\",\"field_54\":\"\",\"field_55\":\"\",\"field_56\":\"\",\"field_57\":\"\",\"field_58\":\"\",\"field_59\":\"\",\"field_60\":\"\",\"field_64\":\"\",\"field_65\":\"\",\"field_66\":\"\",\"field_67\":\"\",\"field_68\":\"\",\"field_69\":\"http:\\/\\/toronto.eventful.com\\/venues\\/the-market-gallery-\\/V0-001-001118352-0?utm_source=apis&amp;amp;utm_medium=apim&amp;amp;utm_campaign=apic\",\"field_70\":\"\",\"field_71\":\"\",\"field_72\":\"\",\"field_73\":\"\",\"field_74\":\"\",\"field_76\":\"\",\"field_77\":\"\",\"field_78\":\"\",\"field_79\":\"Food &amp; Wine -\",\"field_81\":\"2018-09-30 14:00:00\",\"field_82\":\"2018-10-07 14:00:00\",\"field_83\":\"\"}', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', 'Canada', 'Toronto', '2018-09-30 14:00:00', '2018-10-07 14:00:00'),
