(5555, 2118, 8, '{\"field_1\":\"\",\"field_2\":\"\",\"field_3\":\"\",\"field_4\":\"\",\"field_5\":\"Canada\",\"field_6\":\"\",\"field_7\":\"Toronto\",\"field_8\":\"Coffee is, to us, so much more than caffeination. It’s a window into regions to which we cannot always travel, and into the lives of people we cannot always meet. It brings close what is physically distant: agriculture from Africa to South America, roasters from Oregon to Scandinavia. It’s a triumph of science, and a question to which there will never be a satisfying answer. We believe that, through coffee, you can see the world. Every Saturday we cup samples of new coffees that may or may not make it to the Boxcar menu the following week. Come be a part of the selection process, and learn about different coffees from around the world with our team of experts. \",\"field_9\":\"\",\"field_10\":\"Coffee Cupping at Boxcar Summerhill\",\"field_11\":\"\",\"field_12\":\"\",\"field_17\":\"Coffee is, to us, so much more than caffeination. It’s a window into regions to which we cannot always travel, and into the lives of people we cannot always meet. It brings close what is physically distant: agriculture from Africa to South America, roasters from Oregon to Scandinavia. It’s a triumph of science, and a question to which there will never be a satisfying answer. We believe that, through coffee, you can see the world. Every Saturday we cup samples of new coffees that may or may not make it to the Boxcar menu the following week. Come be a part of the selection process, and learn about different coffees from around the world with our team of experts. \",\"field_19\":\"\",\"field_20\":\"\",\"field_21\":\"\",\"field_22\":\"\",\"field_23\":\"\",\"field_24\":\"\",\"field_25\":\"\",\"field_27\":\"\",\"field_28\":\"\",\"field_29\":\"\",\"field_30\":\"\",\"field_31\":\"\",\"field_32\":\"\",\"field_33\":\"\",\"field_36\":\"\",\"field_37\":\"\",\"field_38\":\"\",\"field_39\":\"\",\"field_40\":\"M4T 1W1\",\"field_42\":\"\",\"field_43\":\"\",\"field_44\":\"\",\"field_45\":\"\",\"field_46\":\"\",\"field_47\":\"\",\"field_48\":\"\",\"field_49\":\"\",\"field_50\":\"\",\"field_51\":\"\",\"field_52\":\"\",\"field_53\":\"\",\"field_54\":\"\",\"field_55\":\"\",\"field_56\":\"\",\"field_57\":\"\",\"field_58\":\"\",\"field_59\":\"\",\"field_60\":\"\",\"field_64\":\"\",\"field_65\":\"\",\"field_66\":\"\",\"field_67\":\"\",\"field_68\":\"\",\"field_69\":\"http:\\/\\/toronto.eventful.com\\/venues\\/boxcar-social-\\/V0-001-007901289-7?utm_source=apis&amp;amp;utm_medium=apim&amp;amp;utm_campaign=apic\",\"field_70\":\"\",\"field_71\":\"\",\"field_72\":\"\",\"field_73\":\"\",\"field_74\":\"\",\"field_76\":\"\",\"field_77\":\"\",\"field_78\":\"\",\"field_79\":\"Food &amp; Wine -\",\"field_81\":\"2018-09-22 13:00:00\",\"field_82\":\"2018-09-29 13:00:00\",\"field_83\":\"\"}', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', 'Canada', 'Toronto', '2018-09-22 13:00:00', '2018-09-29 13:00:00'),
(5556, 2118, 1, '{\"field_1\":\"\",\"field_2\":\"\",\"field_3\":\"\",\"field_4\":\"\",\"field_5\":\"Canada\",\"field_6\":\"\",\"field_7\":\"Toronto\",\"field_8\":\"Coffee is, to us, so much more than caffeination. It’s a window into regions to which we cannot always travel, and into the lives of people we cannot always meet. It brings close what is physically distant: agriculture from Africa to South America, roasters from Oregon to Scandinavia. It’s a triumph of science, and a question to which there will never be a satisfying answer. We believe that, through coffee, you can see the world. Every Saturday we cup samples of new coffees that may or may not make it to the Boxcar menu the following week. Come be a part of the selection process, and learn about different coffees from around the world with our team of experts. \",\"field_9\":\"\",\"field_10\":\"Coffee Cupping at Boxcar Summerhill\",\"field_11\":\"\",\"field_12\":\"\",\"field_17\":\"Coffee is, to us, so much more than caffeination. It’s a window into regions to which we cannot always travel, and into the lives of people we cannot always meet. It brings close what is physically distant: agriculture from Africa to South America, roasters from Oregon to Scandinavia. It’s a triumph of science, and a question to which there will never be a satisfying answer. We believe that, through coffee, you can see the world. Every Saturday we cup samples of new coffees that may or may not make it to the Boxcar menu the following week. Come be a part of the selection process, and learn about different coffees from around the world with our team of experts. \",\"field_19\":\"\",\"field_20\":\"\",\"field_21\":\"\",\"field_22\":\"\",\"field_23\":\"\",\"field_24\":\"\",\"field_25\":\"\",\"field_27\":\"\",\"field_28\":\"\",\"field_29\":\"\",\"field_30\":\"\",\"field_31\":\"\",\"field_32\":\"\",\"field_33\":\"\",\"field_36\":\"\",\"field_37\":\"\",\"field_38\":\"\",\"field_39\":\"\",\"field_40\":\"M4T 1W1\",\"field_42\":\"\",\"field_43\":\"\",\"field_44\":\"\",\"field_45\":\"\",\"field_46\":\"\",\"field_47\":\"\",\"field_48\":\"\",\"field_49\":\"\",\"field_50\":\"\",\"field_51\":\"\",\"field_52\":\"\",\"field_53\":\"\",\"field_54\":\"\",\"field_55\":\"\",\"field_56\":\"\",\"field_57\":\"\",\"field_58\":\"\",\"field_59\":\"\",\"field_60\":\"\",\"field_64\":\"\",\"field_65\":\"\",\"field_66\":\"\",\"field_67\":\"\",\"field_68\":\"\",\"field_69\":\"http:\\/\\/toronto.eventful.com\\/venues\\/boxcar-social-\\/V0-001-007901289-7?utm_source=apis&amp;amp;utm_medium=apim&amp;amp;utm_campaign=apic\",\"field_70\":\"\",\"field_71\":\"\",\"field_72\":\"\",\"field_73\":\"\",\"field_74\":\"\",\"field_76\":\"\",\"field_77\":\"\",\"field_78\":\"\",\"field_79\":\"Food &amp; Wine -\",\"field_81\":\"2018-09-22 13:00:00\",\"field_82\":\"2018-09-29 13:00:00\",\"field_83\":\"\"}', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', 'Canada', 'Toronto', '2018-09-22 13:00:00', '2018-09-29 13:00:00'),
(5557, 2119, 8, '{\"field_1\":\"\",\"field_2\":\"\",\"field_3\":\"\",\"field_4\":\"\",\"field_5\":\"Canada\",\"field_6\":\"\",\"field_7\":\"Toronto\",\"field_8\":\"On this all-day tour, enjoy an intimate experience of the wines of Prince Edward County. This region has been garnering fame and recognition locally and worldwide over the past decade. Wines with impeccable mineral quality, great sparkling wines, and a gorgeous country side are the draws which will have you wanting to return again and again. Learn about the region and what makes it special as you drive along the picturesque shore of Lake Ontario. Then over the course of the afternoon, visit three charming wineries with hands-on attention from your guide, a WSET certified wine-lover, as well as the vineyard personal and winemakers. Around mid-day, pizza lunch on the patio will be taken at Norman Hardie&amp;amp;#39;s award winning vineyard. After pickup from your accommodation in Toronto between 8:30am and 9am, journey to Prince Edward County for the day. \\u2028On your tour you&amp;amp;#39;ll visit four wineries, including a small, medium, and large production winery, to give you a good cross-section of the different vineyards in the region. Enjoy a winery tour and tasting at each vineyard with a charcuterie or cheese pairing. Your guide will provide ample information about the climate and geology of the PEC wine region, trends of wine making, and the wines which you&amp;amp;#39;ll taste. After visiting the final vineyard, return to your accommodation in Toronto around 6pm (traffic can affect the timing). TOUR INCLUDES: -Transportation with pick-up and drop-off at your accommodation.- Personable Tour with expert guide. (Max. 6 people per tour) - Lunch at Norman Hardie&amp;amp;#39;s Vineyard - Wine tastings, tours, and charcuterie or cheese pairing at 4 top-shelf vineyards.\",\"field_9\":\"\",\"field_10\":\"Cozy in The County- Wine Tour in Prince Edward County\",\"field_11\":\"\",\"field_12\":\"\",\"field_17\":\"On this all-day tour, enjoy an intimate experience of the wines of Prince Edward County. This region has been garnering fame and recognition locally and worldwide over the past decade. Wines with impeccable mineral quality, great sparkling wines, and a gorgeous country side are the draws which will have you wanting to return again and again. Learn about the region and what makes it special as you drive along the picturesque shore of Lake Ontario. Then over the course of the afternoon, visit three charming wineries with hands-on attention from your guide, a WSET certified wine-lover, as well as the vineyard personal and winemakers. Around mid-day, pizza lunch on the patio will be taken at Norman Hardie&amp;amp;#39;s award winning vineyard. After pickup from your accommodation in Toronto between 8:30am and 9am, journey to Prince Edward County for the day. \\u2028On your tour you&amp;amp;#39;ll visit four wineries, including a small, medium, and large production winery, to give you a good cross-section of the different vineyards in the region. Enjoy a winery tour and tasting at each vineyard with a charcuterie or cheese pairing. Your guide will provide ample information about the climate and geology of the PEC wine region, trends of wine making, and the wines which you&amp;amp;#39;ll taste. After visiting the final vineyard, return to your accommodation in Toronto around 6pm (traffic can affect the timing). TOUR INCLUDES: -Transportation with pick-up and drop-off at your accommodation.- Personable Tour with expert guide. (Max. 6 people per tour) - Lunch at Norman Hardie&amp;amp;#39;s Vineyard - Wine tastings, tours, and charcuterie or cheese pairing at 4 top-shelf vineyards.\",\"field_19\":\"\",\"field_20\":\"\",\"field_21\":\"\",\"field_22\":\"\",\"field_23\":\"\",\"field_24\":\"\",\"field_25\":\"\",\"field_27\":\"\",\"field_28\":\"\",\"field_29\":\"\",\"field_30\":\"\",\"field_31\":\"\",\"field_32\":\"\",\"field_33\":\"\",\"field_36\":\"\",\"field_37\":\"\",\"f