(5558, 2119, 1, '{\"field_1\":\"\",\"field_2\":\"\",\"field_3\":\"\",\"field_4\":\"\",\"field_5\":\"Canada\",\"field_6\":\"\",\"field_7\":\"Toronto\",\"field_8\":\"On this all-day tour, enjoy an intimate experience of the wines of Prince Edward County. This region has been garnering fame and recognition locally and worldwide over the past decade. Wines with impeccable mineral quality, great sparkling wines, and a gorgeous country side are the draws which will have you wanting to return again and again. Learn about the region and what makes it special as you drive along the picturesque shore of Lake Ontario. Then over the course of the afternoon, visit three charming wineries with hands-on attention from your guide, a WSET certified wine-lover, as well as the vineyard personal and winemakers. Around mid-day, pizza lunch on the patio will be taken at Norman Hardie&amp;amp;#39;s award winning vineyard. After pickup from your accommodation in Toronto between 8:30am and 9am, journey to Prince Edward County for the day. \\u2028On your tour you&amp;amp;#39;ll visit four wineries, including a small, medium, and large production winery, to give you a good cross-section of the different vineyards in the region. Enjoy a winery tour and tasting at each vineyard with a charcuterie or cheese pairing. Your guide will provide ample information about the climate and geology of the PEC wine region, trends of wine making, and the wines which you&amp;amp;#39;ll taste. After visiting the final vineyard, return to your accommodation in Toronto around 6pm (traffic can affect the timing). TOUR INCLUDES: -Transportation with pick-up and drop-off at your accommodation.- Personable Tour with expert guide. (Max. 6 people per tour) - Lunch at Norman Hardie&amp;amp;#39;s Vineyard - Wine tastings, tours, and charcuterie or cheese pairing at 4 top-shelf vineyards.\",\"field_9\":\"\",\"field_10\":\"Cozy in The County- Wine Tour in Prince Edward County\",\"field_11\":\"\",\"field_12\":\"\",\"field_1