(403072, 8, 2087, 8, 'Whether you’re a craft beer newbie or a seasoned imbiber… a tour through Big Rock Brewery, Canada’s leading craft brewery, is a great way to spend some of your valued time in Ontario. In fact, consider it an investment in DELICIOUS! Led by a TEAM of beer passionate folks who live, love and drink craft beer, enjoy a 60-minute brewery tour and tasting. You&amp;amp;#39;ll follow our state-of-the-art brewing process with your own eyes, ears and nose, from the unloading of ingredients, through the brewing and fermentation stages, all the way to the packaging facility. Before you head home, you&amp;amp;#39;ll experience a Big Rock tasting session where you get to sample the latest and greatest on tap.  Tours take place every Saturday at 1pm and 4pm.  Large group private tour packages are available for booking – please email info.bro@bigrockbeer.com for more details. Big Rock Brewery Store Hours  Monday- CLOSED Tuesday- CLOSED Wednesday, Thursday and Friday: 4:00pm - 8:00pm Saturday: 11:00am - 7:00pm Sunday: 1:00pm - 5:00pm Any Questions or concerns please contact 647.351.7837 ***FAQs***  Are there ID requirements or an age limit to enter the event? Participants must be 19 years of age or older with valid identification.    What can/can&amp;amp;#39;t I bring to the event? PLEASE BRING: Government photo ID (required to participate in sampling of beer) PLEASE DO NOT BRING: Outside alcohol. Anyone arriving on premise that appears to be impaired will be unable to participate in our brewery tours.   Do I have to bring my printed ticket to the event? No. Since you will have your ID with you, we can verify your identity that way. No need to print anything out!', NULL),
