(404590, 8, 2098, 8, 'Join the fourth annual Toronto Craft Cider Cruise aboard The River Gambler on the harbourfront. This Ontario Cider Week event is positioned as a premier cider event for the true craft connoisseur. Ontario’s finest cider prodcuers have been selectively invited to participate on this voyage. It’s going to be a celebration of the craft as we take this festival to the Harbour. One sailing  scheduled on Saturday, August 4th at 2pm  This sailing will run for a “three hour tour” on the water. Tickets are $40.00  and includes three sample tokens and a commemorative mug. Space is limited so book your tickets now! www.craftcidercruise.com', NULL),
