(406508, 1, 2111, 10, 'Canadian Premiere: Artes Liberales 大学之道 - Mulan International Film Festival', NULL),
(406509, 1, 2111, 8, 'Join us for the Canadian Premiere of Artes Liberales and on-stage panel talk! Premiered at the 2018 China Education Symposium at Harvard University, this documentary film explores the concept of “liberal arts education” and the perceptions of how international students from feel about the liberal arts education system in the US. It brings a blend of interviews with professors, scholars, parents and students, discussing the academic challenges these Chinese students may face when they pursue higher education in the US. 《大学之道》以哈佛大学教育学院的毕业研究生为主要采访对象，展开了对博雅教育的概念和意义的探讨，并记录下了中国留学生在美国求学时面对的主要碰撞、在文化差异中的成长，以及他们在理念和视野上的变化。任何一位留学海外的中国学生，或许都能在采访分享中看到似曾相识的经历——那些如何找到自我、找到出路，以及怎样分辨善恶，又怎样做出选择的种种过往或如今。本片在2018年4月的哈佛中国教育论坛上举行首映，引起了教育学者、师生和家长的极大反响。 Credits 演职员名单 Director 导演：CHEN Ceng 陈层 Producer 制片人：CHEN Ceng 陈层、Joe JIAO 焦念韬、Starry ZHU 朱晓薇 Cinematographer 摄影： CHEN Ceng 陈层、LI Hongyi 李弘毅 Editor 剪辑：CHEN Ceng 陈层 Sound 音效：Jared AMBROSE、CHEN Ceng 陈层', NULL),
(406510, 1, 2111, 17, '<p>Join us for the Canadian Premiere of&nbsp;Artes Liberales and on-stage panel talk! Premiered at the 2018 China Education Symposium at Harvard University, this documentary film explores the concept of &ldquo;liberal arts education&rdquo; and the perceptions of how international students from feel about the liberal arts education system in the US. It brings a blend of interviews with professors, scholars, parents and students, discussing the academic challenges these Chinese students may face when they pursue higher education in the US. 《大学之道》以哈佛大学教育学院的毕业研究生为主要采访对象，展开了对博雅教育的概念和意义的探讨，并记录下了中国留学生在美国求学时面对的主要碰撞、在文化差异中的成长，以及他们在理念和视野上的变化。任何一位留学海外的中国学生，或许都能在采访分享中看到似曾相识的经历&mdash;&mdash;那些如何找到自我、找到出路，以及怎样分辨善恶，又怎样做出选择的种种过往或如今。本片在2018年4月的哈佛中国教育论坛上举行首映，引起了教育学者、师生和家长的极大反响。 Credits&nbsp;演职员名单 Director 导演：CHEN Ceng 陈层 Producer 制片人：CHEN Ceng 陈层、Joe JIAO 焦念韬、Starry ZHU 朱晓薇 Cinematographer 摄影：&nbsp;CHEN Ceng 陈层、LI Hongyi 李弘毅 Editor 剪辑：CHEN&nbsp;Ceng&nbsp;陈层 Sound 音效：Jared AMBROSE、CHEN Ceng 陈层</p>', NULL),
