(407068, 8, 2113, 8, 'Think French baking is complicated? Actually, it&amp;amp;#39;s a jeu d&amp;amp;#39;enfant - so easy even kids can create beautiful desserts!  Join Mardi Michels author the upcoming &amp;amp;quot;In the French Kitchen with Kids&amp;amp;quot; (Appetite by Random House July 2018) in the kitchen to learn how to cook some classic French sweet treats with your child in this interactive class. In this class, you and your child will learn to make: Madeleines: Shell-shaped sponge cakes with a lemon glaze; Mini tartes aux fruits: Melt-in-your-mouth pastry topped with crème pâtissière and fresh fruits; Langues de Chat: Thin, crunchy cookies shaped like cat’s tongues; Chocolate Coeur à la Crème:  a classic French dessert, so easy you’ll want to make it even on a weeknight Class is suitable for children 7-14. Children must be accompanied by at least one adult. Single adult or child tickets may only be purchased as additions to at least one adult/child ticket combo. This class requires a minimum of 8 adult/child pairs to run. ***Please note – no refund for cancellations made after September 23rd 2018. Tickets are transferable only after that date.', NULL),
