(407620, 8, 2117, 8, 'BEACH - SUN - SAND! Join us for the last and largest summer beach festival!  FREE &amp;amp; FUN \n\nAll happening on Woodbine Beach: 1675 Lakeshore Blvd East : Sept 22-23rd Noon-8pm\n\nLet us know you’re coming! Eventbrite: http://bit.ly/2MvftcG\nInvite friends, bring your flip flops and your appetite to\n- INDULGE at Beachside Eats: Featuring Local Restaurants \n- SIP Beachside Drinks: Craft beer from the East, Wine &amp;amp; Cocktails\n- SHOP the Beachside Market: Artisanal Style\n- GROOVE to cool tunes: 80&amp;amp;#39;s &amp;amp; 90&amp;amp;#39;s all day\n\nBring your flip flops and shades! Over 50 vendors bringing you some fun in the sun! \n\nCheck out last year!  https://youtu.be/uAwXKaw42vg \n\nFREE ENTRANCE ALL DAY\n\nON WOODBINE BEACH\n1675 Lakeshore Blvd East\n\n(behind the bathing station.. just follow the music)\n\nStay Connected!\n\nwww.beachesfestival.ca\n\nFacebook | Instagram : @torontobeachesfest\n\n___________________________________________________\n\nRain or Shine.. This event will go on.\n\nOUR MOTTO : NO SHIRT - NO SHOES - NO PROBLEM!\n\n___________________________________________________\nIn order to sample &amp;amp; purchase drinks, you must purchase a souvenir glass on-site for $10, 19+ Bring I.D. Portion of proceeds support the local hospital. Have fun and do good at the same time!  http://foundation.tegh.on.ca/\n\nPurchase the VIP Package on-line to by-pass the line, receive your glass on-site and 1 drink/food token to get you started.', NULL),
