(407758, 8, 2118, 8, 'Coffee is, to us, so much more than caffeination. It’s a window into regions to which we cannot always travel, and into the lives of people we cannot always meet. It brings close what is physically distant: agriculture from Africa to South America, roasters from Oregon to Scandinavia. It’s a triumph of science, and a question to which there will never be a satisfying answer. We believe that, through coffee, you can see the world. Every Saturday we cup samples of new coffees that may or may not make it to the Boxcar menu the following week. Come be a part of the selection process, and learn about different coffees from around the world with our team of experts. ', NULL),
