(407896, 8, 2119, 8, 'On this all-day tour, enjoy an intimate experience of the wines of Prince Edward County. This region has been garnering fame and recognition locally and worldwide over the past decade. Wines with impeccable mineral quality, great sparkling wines, and a gorgeous country side are the draws which will have you wanting to return again and again. Learn about the region and what makes it special as you drive along the picturesque shore of Lake Ontario. Then over the course of the afternoon, visit three charming wineries with hands-on attention from your guide, a WSET certified wine-lover, as well as the vineyard personal and winemakers. Around mid-day, pizza lunch on the patio will be taken at Norman Hardie&amp;amp;#39;s award winning vineyard. After pickup from your accommodation in Toronto between 8:30am and 9am, journey to Prince Edward County for the day.  INSERT INTO `property_value` (`id`, `language_id`, `property_id`, `option_id`, `value`, `value_num`) VALUES
